import styled from 'styled-components';

export const InfoBar =styled.div`
padding: 10%;
width: 100%;
height: 160px;
background: #000;
`;

export const Infoh1 =styled.h1`
font-weight:900;
font-size: 22px;
color:#fff;
`;

export const InfoP = styled.p`
font-weight: 300;
color: #fff;
font-size: 12px;
`;
